import Reacr from 'react';

class Mycar extends Reacr.Component {
    constructor(props){
        super();
        this.state = {
            brand: 'Ford',
            model: 'Mustang',
            color: 'Red',
            year: 1964,
        }
    };

    render(){
        return (
            <div>
            <p>My car is {this.state.brand} {this.state.model} {this.state.year} and it's  {this.state.color}</p>
            </div>
        )
    }
}

export default Mycar;
